package com.example.Quora.models;import jakarta.persistence.*;import lombok.*;@Entity@Getter@Setter@NoArgsConstructor@AllArgsConstructor@Builderpublic class Like {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @Enumerated(EnumType.STRING)    private  Liketoggle liketoggle;    @ManyToOne    private  User user;    @ManyToOne    private  Question question;    @Override    public String toString() {        return "Like{" +                "id=" + id +                ", liketoggle=" + liketoggle +                ", user=" + user +                ", question=" + question +                ", comment=" + comment +                ", answer=" + answer +                '}';    }    @ManyToOne    private  Comment comment;    @ManyToOne    private  Answer answer;}